   "source": [
    "# ngl that was pretty cool, trying it with Cocoa_Percent now\n",
    "chocolateData %>%\n",
    "    group_by(Review_Date) %>% # still same thing we are groupding by\n",
    "    summarise(averageCocoaPerc = mean(Cocoa_Percent),\n",
    "              sdCocoaPerc = sd(Cocoa_Percent))"
