   "source": [
    "# Your turn!\n",
    "\n",
    "# Make & save a data_frame with the average and sd Cocoa_Percent by the year the reviews were written\n",
    "Cocoa_Percent_summ <- chocolateData %>%\n",
    "    group_by(Review_Date) %>%\n",
    "    summarise(averageCocoaPercent = mean(Cocoa_Percent),\n",
    "             sdCocoaPercent = sd(Cocoa_Percent),\n",
    "             avgRating = mean(Rating))\n",
    "\n",
    "# Plot the data_frame you've made using your choice of geom(s)\n",
    "plot <- ggplot(Cocoa_Percent_summ, \n",
    "               aes(y= averageCocoaPercent, x = Review_Date)) + \n",
    "    geom_point() + # plot individual points\n",
    "    geom_errorbar(aes(ymin=averageCocoaPercent-sdCocoaPercent, ymax=averageCocoaPercent+sdCocoaPercent), \n",
    "                  width=.2,\n",
    "                  position=position_dodge(.9)) + # sd as error bars\n",
    "    geom_smooth(method = stats::loess) # curve of best fit?\n",
    "    \n",
    "# Extra credit: Add a title to your plot. You may find the function ggtitle() helpful\n",
    "plot + labs(title = \"Average (mean) Cocoa Percent by Review Date\", \n",
    "            subtitle = \"w/ Curve of Best Fit and Standard Deviation Error Bars\")\n",
    "\n",
    "# Save your plot to the output"
   ]
  }
